import React, { Component } from 'react'
import axios from 'axios'



 class PostList extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
             posts: []
        }
    }

    componentDidMount(){
        axios.get('https://jsonplaceholder.typicode.com/posts').then(
            Response =>{
                console.log(Response)
            }
        ).catch(error =>{
            console.log(error)
        })
    }
    
    render() {
        return (
            <div>
                <h1>List of Posts</h1>
            </div>
        )
    }
}

export default PostList
